pub(super) fn native_libraries() -> Vec<Library> {
    let mut cb_data = CallbackData {
        libs: Vec::new(),
        #[cfg(not(target_os = "hurd"))]
        maps: parse_running_mmaps::parse_maps().ok(),
        #[cfg(target_os = "hurd")]
        maps: None,
    };
    unsafe {
        libc::dl_iterate_phdr(Some(callback), core::ptr::addr_of_mut!(cb_data).cast());
    }
    cb_data.libs
}
